    def noticias_titulos(self):
        # //div [@class="feed-post-body"]/div[@class="feed-post-body-title gui-color-primary gui-color-hover "]/div/a
        titulos = self.driver.find_elements_by_xpath('//div [@class="feed-post-body"]/div[@class="feed-post-body-title gui-color-primary gui-color-hover "]/div/a')
        
        for i, titulo in enumerate(titulos):
            titulo = titulo.text
            self.noticias[i] = {"titulo":titulo}

